import axios from 'axios'
import Login from './auth/Login';

const {REACT_APP_API_BASE_URL} = process.env;

export function checkAccessRights() {
    try{
        let accessRights = [];
        token = localStorage.getItem('token');
        axios.get(`${REACT_APP_API_BASE_URL}authentication/accessrights/`, {Authorization: `Token ${token}`})
            .then(res => accessRights = res.data);
        return accessRights
    }
    catch{
        return false
    }
}

